export const Map = () => {
  const center = { lat: 48.8668142, lng: 2.3333062 };

  return (
    <GoogleMap
      zoom={10}
      center={center}
      mapContainerStyle={{ width: '100%', height: '90vh' }}
    ></GoogleMap>
  );
};
